const sortByAmount = () => {
  return {
    type: 'SORT_BY_AMOUNT'
  }
}

const sortByDate = () => {
  return {
    type: 'SORT_BY_DATE'
  }
}
const sortByText = () => {
  return {
    type: 'SORT_BY_TEXT'
  }
}
const setStartDate = (startDate) => {
  return {
    type: 'SET_START_DATE',
    startDate
  }
}
const setEndDate = (endDate) => {
  return {
    type: 'SET_END_DATE',
    endDate
  }
}
